use dep::std::hash::poseidon;
use dep::std::eddsa::eddsa_poseidon_verify;
use dep::smt;
use dep::zkvc::{AccessControlCriteria, UnifiedCredential, Condition, Credential, Issuer, validate_conditions, validate_predicates};


global MAX_CLAIMS = 1;


// 1 CONDITION
